import React from 'react';
import '../style/footer.css';
import Logo from '../assets/logo.svg'

const Footer = () => {
  return (
      <footer>
          <div className="footer-logo">
              <img src={Logo} alt="logo"/>
          </div>
          <div className="footer-links">
              <div className="footer-about">About</div>
              <div className="footer-services">Services</div>
              <div className="footer-projects">Projects</div>
          </div>
          <div className="footer-icons">
              <img src="" alt="" className="icons-facebook" />
              <img src="" alt="" className="icons-instagram" />
              <img src="" alt="" className="icons-twitter" />
              <img src="" alt="" className="icons-facebook" />
          </div>
      </footer>
  );
};

export default Footer;
